import React from 'react';
import './App.css';



const App = () => {
  return (
    <div className='app-wrapper'>

      <aside>
        <div>
          <a>My profile</a>
        </div>
        <div>
          <a>Messeges</a>
        </div>
        <div>
          <a>News</a>
        </div>
        <div>
          <a>Music</a>
        </div>
        <div>
          <a>Settings</a>
        </div>
      </aside>

    </div>
  );
}



export default App;
